const { Component } = require("react");

class Header extends Component {
    render() {
        return(
            <div className="header">
                <div className="logo_icons">

                </div>
                <div className="navbar">
                    <li className="Horizontal_Item">
                        <a href="#">shop</a>
                    </li>
                    <li className="Horizontal_Item">
                        <a href="#">Our Story</a>
                    </li>
                    <li className="Horizontal_Item">
                        <a href="#">Happy Customers</a>
                    </li>
                    <li className="Horizontal_Item">
                        <a href="#">Contact Us</a>
                    </li>
                </div>
            </div>
        )
    }
}

export default Header;
